$templateCache.put("app/privacidad/privacidad.html","<div ng-include=\"\'app/components/menu/menu.html\'\"></div><div class=container><h1>Aviso de privacidad<br><small>www.visor.io y todos sus subdominios</small></h1><div class=\"panel panel-default\"><div class=panel-body>El presente Aviso de Privacidad celebrado entre VISOR ADL, S.A.P.I. DE C.V. (“VISOR”) y el titular de la información (Tú), establece la manera en que será tratada tu información por parte de VISOR, así como la finalidad para la que fue recabada. Esto de conformidad con los Artículos 15 y 16 de la Ley Federal de Protección de Datos Personales en Posesión de los Particulares (la ”LFPDPP”) y artículos 23 al 27 del Reglamento de la LFPDPP. VISOR respeta el derecho a la privacidad y protección de datos personales, los cuales están amparados bajo la LFPDPP. La base de datos en donde consta tu información es responsabilidad de VISOR y se puede encontrar guardada en medios físicos y/o alojada en servidores contratados bajo un esquema de hospedaje, siempre cumpliendo con los más altos estándares en esquemas de seguridad de la información. VISOR será responsable de que tus datos personales se encuentren debidamente resguardados conforme a las disposiciones de seguridad administrativa, técnica y física establecidas en la LFPDPP, protegiendo la confidencialidad, integridad y disponibilidad de dicha información; para lo cual tomará todas las medidas de previsión para que los terceros con quiénes contrate la renta de servidores cumplan con el mismo nivel de protección.</div></div></div><div class=container ng-controller=AccordionDemoCtrl><uib-accordion close-others=oneAtATime><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Datos generales <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>VISOR es una plataforma de financiamiento que trabaja de la mano con compañías multinacionales para identificar empresas como la tuya y ofrecerles financiamiento cuando lo necesitan. Mediante el análisis de la información de tu empresa somos capaces de identificar a la institución financiera que ofrece el crédito o servicio más adecuado para tus necesidades con una tasa que se apegue a tu perfil de riesgo. Además, hacemos que el proceso de contratación sea rápido y fácil. Las oficinas de VISOR se encuentran ubicadas en Amsterdam número 101, Colonia Hipódromo Condesa, México, D.F., Delegación Cuauhtémoc C.P. 06100. El teléfono es: 55 66720447.DATOS</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Datos personales que se pueden llegar a recabar <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>Los datos personales que podemos llegar a recabar son:<br>Nombre; Apellidos; domicilio; teléfono; dirección de correo electrónico; Registro Federal deContribuyentes; Nacionalidad; fecha de nacimiento; lugar de nacimiento; estado civil; ocupación.<br>Para identificarte podemos solicitar original y copia simple de los siguientes documentos: Credencial de Elector, Pasaporte, Cédula Profesional, documentos que contienen datos personales tales como: Nombre, edad, sexo, domicilio, huella dactilar, clave de elector, Clave Única de Registro de Población, fotografía, firma autógrafa, registro federal de contribuyentes, fecha de nacimiento, lugar de nacimiento, nacionalidad, grado de estudios. Recabamos también, los siguientes datos financieros o patrimoniales: Nombre del Banco donde tengas tu cuenta bancaria, Clabe, copia simple de estados de cuenta bancarios, los cuales contienen información de los depósitos y retiros realizados de tus cuentas, cheques que hayas cobrado o pagado, comisiones cobradas, pagos realizados y nombre de los beneficiarios de dichos pagos, nombre de las personas que realicen depósitos a las respectivas cuentas.<br>NO recabamos datos personales sensibles, de aquellos definidos como tales por la LFPDPP.<br>Otros tipos de información que se puede llegar a recabar:<br>- En ocasiones, VISOR y/o los navegadores que se utilizan como auxiliares para acceder a la página web de VISOR, almacenan <strong>cookies</strong> y/o <strong>web beacons</strong> en las computadoras y/o demás dispositivos que utilicen los titulares de datos personales para navegar por Internet y acceder a la página web respectiva.<br>Los cookies y web beacons son pequeñas piezas de información que son enviadas por el sitio Web a tu navegador y se almacenan en el disco duro de tu equipo y se utilizan para brindar mayor eficiencia en el servicio, para determinar tus preferencias cuando te conectas a los servicios de nuestros sitios, así como para rastrear determinados comportamientos o actividades llevadas a cabo por ti, como titular de datos personales dentro de nuestros sitios.<br>En algunas secciones de nuestro sitio podríamos requerir que tengas habilitados los cookies y web beacons ya que algunas de las funcionalidades requieren de éstas para trabajar. Los cookies y web beacons nos permiten: a) reconocerte al momento de entrar a nuestros sitios y ofrecerte una experiencia personalizada, b) conocer la configuración personal del sitio especificada por ti, por ejemplo, los cookies nos permiten detectar el ancho de banda que has seleccionado al momento de ingresar al home page de nuestros sitios, de tal forma que sabemos qué tipo de información es aconsejable descargar, c) calcular el tamaño de nuestra audiencia y medir algunos parámetros de tráfico, pues cada navegador que obtiene acceso a nuestros sitios adquiere un cookie que se usa para determinar la frecuencia de uso y las secciones de los sitios visitadas, reflejando así tus hábitos y preferencias, información que nos es útil para mejorar el contenido, los titulares y las promociones para los usuarios. Las cookies también nos ayudan a rastrear algunas actividades, por ejemplo, en algunas de las encuestas, cuestionarios y/o información de contacto que lanzamos en línea, podemos utilizar cookies para detectar si has llenado la encuesta y/o información solicitada, y evitar desplegarla nuevamente, en caso de que lo hayas hecho. Sin embargo, las cookies te permitirán tomar ventaja de las características más benéficas que te ofrecemos, por lo que te recomendamos que las dejes activadas.<br>La utilización de cookies y web beacons no será utilizada para identificarte personalmente, con excepción de los casos en que se investiguen posibles actividades fraudulentas.<br>Cualquier información o datos adicionales que no se encuentren dentro de los mencionados anteriormente, que sean obtenidos por VISOR, ésta se obliga a informarte que cuenta con datos adicionales y que los mismos deberán ser obtenidos con tu consentimiento, así como resguardarlos bajo la entera responsabilidad de VISOR. Liberando a AMEXCO de cualquier reclamo al respecto.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Forma en que recabamos tus datos personales <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>La forma de recabar tus datos personales es en forma directa, cuando acudes a nuestras oficinas a celebrar con nosotros alguna operación comercial en tu carácter de persona física con actividad empresarial y/o de socio, director, gerente, representante legal y/o apoderado legal de alguno de nuestros clientes; o cuando acudimos a tus oficinas o al domicilio que nos indiques.<br>Así mismo llegamos a recabar datos personales vía nuestra página web: <a href=http://www.visor.io>www.visor.io</a> y todos sus subdominios, lugar donde se encuentra publicado este Aviso de Privacidad. También podemos recabar tus datos personales vía telefónica, para lo cual te haremos saber sobre este aviso de privacidad.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Finalidad <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p><strong>¿Para qué utilizamos estos datos personales?</strong><br>VISOR ha recabado y recabará tus datos personales para poder identificarte como persona física con actividad empresarial y/o como socio, director, gerente, representante legal y/o apoderado legal de alguno de nuestros clientes; esto para fines de seguridad y para fines de la contratación de los productos y/o los servicios que ofrecemos.<br>Los datos financieros y patrimoniales los recabamos para efecto del servicio de análisis de datos que te ofrecemos y, siempre y cuando, estés de acuerdo en contratar este servicio. <strong>Finalidades Secundarias</strong><br>Por otro lado, también podremos usar tus datos personales para fines de estudios de mercado relacionados con los productos y/o servicios que ofrecemos. Asimismo, pudiera utilizarse la información personal para que VISOR ofrezca productos y/o servicios relacionados vía correo electrónico, vía telefónica o física, siempre en cumplimiento de la LFPDPP y de la Ley de la Procuraduría Federal del Consumidor.<br>En caso de que no desees que tus datos personales sean tratados para estos fines adicionales puedes enviar un correo electrónico a contact@visor.io en los términos de lo señalado en el capítulo de Derechos ARCO, y tus datos personales no serán tratados para estas finalidades secundarias. La negativa para el uso de tus datos personales para estas finalidades secundarias, no podrá ser un motivo para que te neguemos los servicios y productos que solicitas contratar con nosotros.<br>La información que nos brindes deberá ser veraz y completa. Para tal efecto tendrás el derecho de acceso a la información que nos proporcionaste y la posibilidad de rectificar y actualizar la información en cualquier momento, de conformidad con lo previsto en el presente Aviso de Privacidad.</p><p><strong>¿Qué pasa si VISOR no tiene tus Datos Personales?</strong><br>En el supuesto de que VISOR no cuente con los datos personales antes enumerados, o de que desees ejercer tu derecho de oposición o cancelación de datos conforme lo previsto por la Ley Federal de Protección de Datos Personales en Posesión de los Particulares; VISOR no podrá celebrar contrato u operación comercial contigo o con tú representada y/o apoderada.<br>En el caso de aquellos datos que se te solicitan cuando visitas las instalaciones de VISOR a efecto de poder identificarte, si no quisieras proporcionarlos, entonces no podrás entrar a las instalaciones respectivas.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Derechos arco <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>Tú tienes el derecho de acceder a los datos personales que poseemos y a los detalles del tratamiento de los mismos, así como a rectificarlos en caso de ser inexactos.<br>También tienes el derecho de instruirnos cancelarlos, siempre y cuando no exista una obligación pendiente derivada del contrato o de la operación comercial que hayas celebrado directamente como persona física con actividad empresarial o en tu carácter de representante y/o apoderado legal con VISOR u obligación pendiente que cumplir ya sea por VISOR, por ti o por tú representada y/o apoderada, de conformidad con las disposiciones legales vigentes.<br>Tú, como titular de los datos personales podrás ejercer los derechos de acceso, rectificación, cancelación y oposición respecto a los datos personales de tu propiedad, haciendo una solicitud a VISOR &nbsp;vía correo electrónico a <a href=mailto:contact@visor.io>contact@visor.io</a> , indicando por lo menos lo siguiente:</p><ol><li>Nombre, domicilio y dirección de correo electrónico;</li><li>Documentos que acrediten tu identidad, o , en su caso, la representación legal;</li><li>Descripción clara y precisa de los datos personales respecto de los que busques ejercer alguno de los derechos antes mencionados;</li><li>Cualquier otro elemento o documento que facilite la localización de los datos personales respectivos.</li></ol><p>En un plazo máximo de veinte días hábiles contados desde la fecha en que recibamos tu solicitud, atenderemos tu petición y te haremos saber sobre la procedencia de la misma, a través de la dirección de correo electrónico que nos hayas proporcionado en tu solicitud.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Responsable de atender solicitudes arco <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>Nuestro responsable de atender las solicitudes de acceso, rectificación, cancelación y oposición en nombre de VISOR es Rubén Alfredo Sánchez Souza, quién se ubica en el mismo domicilio de VISOR, y a quién se puede contactar personalmente en la siguiente dirección de correo electrónico: <a href=mailto:dudas@visor.io>dudas@visor.io</a> <strong><em>.</em></strong></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Transferencia de datos personales <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>La Información que TÚ nos proporciones directa y/o indirectamente, al hacer uso de nuestro sitio web y/o al contratar en tu carácter de persona física con actividad empresarial o en tu carácter de representante y/o apoderado legal de alguno de nuestros clientes los servicios que ofrece VISOR, podrá ser transferida dentro de la República Mexicana y/o al extranjero a: (a) Instituciones Financieras; (b) empresas con las que TÚ y/o tu <em>representada y/o apoderada </em>tenga y/o haya tenido una relación comercial; (d) Cámaras y/o Asociaciones con las que estés relacionado y/o tu representada y/o apoderada esté relacionada.<br>Se podrá compartir información no identificable para fines informativos y de publicidad a diversos clientes y terceros.</p><p><strong>Remisiones</strong><br>VISOR podrá efectuar remisiones de información nacionales y/o extranjeras a terceros que le prestan los servicios necesarios para poder proveerte los servicios de VISOR en forma eficiente y conforme a derecho. Estos terceros son nuestros proveedores, tales como contadores, abogados, auditores, proveedores de servicios de hospedaje de datos, proveedores de servicios de seguridad en informática, proveedores de servicios de tecnologías de la información, programadores y técnicos involucrados en administrar este sitio de internet. Dichos proveedores se obligarán frente a VISOR a respetar este Aviso de Privacidad y responderán por el mal uso que le pudieran dar a los datos personales a los que lleguen a tener acceso.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Límite de uso y divulgación de la información <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>El titular de la información (tú) podrá en cualquier momento limitar el uso y divulgación de los datos personales que haya proporcionado a VISOR mediante una solicitud enviada al responsable de datos personales conforme a lo establecido anteriormente.<br>Para el supuesto de la información que pudiera llegar a ser recabado por herramientas como <strong>Cookies y/o Web Beacons</strong> que normalmente utilizan los navegadores y en ocasiones el portal de VISOR. Las cookies y/o Web Beacons de los navegadores podrán ser deshabilitadas de acuerdo a los procedimientos indicados por cada navegador en la sección de ayuda.<br>Al acceder a nuestro sitio web <a href=http://www.visio.>www.visio.io</a>; existe información almacenada por los navegadores, esta información puede incluir datos personales o no, como email y otros que se solicitan en nuestra página web, Para evitar que terceras personas accedan a ellos es recomendable borrar las cookies después de navegar en nuestro sitio a través del procedimiento indicado por el navegador que estés utilizando.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Excepciones <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>De conformidad con lo estipulado en los artículos 10, 37 y demás relativos de la LFPDPP, VISOR quedará exceptuado de las obligaciones referentes a obtener consentimiento para tratamiento y transferencia de datos personales, cuando: Para el caso del tratamiento:</p><ol><li>Esté previsto en una Ley;</li><li>Los datos figuren en fuentes de acceso público;</li><li>Los datos personales se sometan a un procedimiento previo de disociación;</li><li>Tenga el propósito de cumplir obligaciones derivadas de una relación jurídica entre tú como titular de datos personales y VISOR;</li><li>Exista una situación de emergencia que potencialmente pueda dañar a un individuo en su persona o en sus bienes;</li><li>Sean indispensables para la atención médica, la prevención, diagnóstico, la prestación de asistencia sanitaria, tratamientos médicos o la gestión de servicios sanitarios;</li><li>Se dicte resolución de autoridad competente;Para el caso de transferencia de datos personales:<ul><li>Cuando la transferencia esté prevista en una Ley o Tratado en los que México sea parte;</li><li>Cuando la transferencia sea necesaria para la prevención o el diagnóstico médico, la prestación de asistencia sanitaria, tratamiento médico o la gestión de servicios sanitarios;</li><li>Cuando la transferencia sea efectuada a sociedades controladoras, subsidiarias o afiliadas bajo el control común de VISOR, o a una sociedad matriz o a cualquier sociedad del mismo grupo del responsable que opere bajo los mismos procesos y políticas internas;</li><li>Cuando la transferencia sea necesaria por virtud de un contrato celebrado o por celebrar en tu interés, por VISOR y un tercero;</li><li>Cuando la transferencia sea necesaria o legalmente exigida para la salvaguarda de un interés público, o para la procuración o administración de justicia;</li><li>Cuando la transferencia sea precisa para el reconocimiento, ejercicio o defensa de un derecho en un proceso judicial y;</li><li>Cuando la transferencia sea precisa para el mantenimiento o cumplimiento de una relación jurídica entre VISOR y tú como titular de datos personales.</li></ul></li></ol></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Consentimiento <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>De conformidad con la LFPDPP el ponerte a disposición el presente Aviso de Privacidad y que tu no manifiestes oposición alguna, significará que tenemos tu consentimiento emitido en forma tácita para usar tus datos personales de conformidad con lo aquí previsto.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Modificaciones <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>VISOR se reserva el derecho de efectuar en cualquier momento modificaciones o actualizaciones al presente Aviso de Privacidad, para la atención de novedades legislativas, políticas internas o nuevos requerimientos para la prestación u ofrecimiento de nuestros servicios.<br>Estas modificaciones estarán disponibles al público a través de nuestra página web: <a href=http://www.visor.io>www.visor.io</a>. La fecha de la última actualización al presente aviso de privacidad: [27/03/2017].<br></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Denuncias <i class=\"pull-right fa\" ng-class=\"{\'fa-chevron-down\': status.open, \'fa-chevron-right\': !status.open}\"></i></uib-accordion-heading><uib-accordion-body><p>¿Ante quién puedes presentar tus quejas y denuncias por el tratamiento indebido de tus datos personales?<br>Si después de habernos solicitado cualquier aclaración por los medios que en este documento le proporcionamos; consideras que tus datos personales están siendo tratados en forma indebida; puedes interponer la queja o denuncia correspondiente ante el Instituto Nacional de Transparencia, Acceso a la Información y Protección de Datos Personales (INAI), para mayor <a name=_GoBack></a>información visita <a href=http://www.inai.org.mx>www.inai.org.mx</a></p><p></p></uib-accordion-body></div></uib-accordion></div>");
$templateCache.put("app/profit/profit.html","<div ng-include=\"\'app/components/menu/menu.html\'\"></div><div class=container><h1>Gráfica de ganancias</h1></div><div class=container-fluid><div id=graph3></div></div><br><br><script>$(function () {\n    Highcharts.chart(\'graph3\', {\n        chart: {\n            type: \'line\'\n        },\n        title: {\n            text: \'\'\n        },\n        subtitle: {\n            text: \'\'\n        },\n        xAxis: {\n            categories: [\'Jan\', \'Feb\', \'Mar\', \'Apr\', \'May\', \'Jun\', \'Jul\', \'Aug\', \'Sep\', \'Oct\', \'Nov\', \'Dec\']\n        },\n        yAxis: {\n            title: {\n                text: \'Dinero\'\n            }\n        },\n        plotOptions: {\n            line: {\n                dataLabels: {\n                    enabled: true\n                },\n                enableMouseTracking: false\n            }\n        },\n        series: [{\n            name: \'Flujo estimado de beneficios\',\n            data: [100000, 120000, 125000.5, 126000.5, 127000.4, 125000.5, 122000.2, 116000.5, 100000.3, 75000.3, 70000.9, 90000.6]\n        }, {\n            name: \'Flujo real\',\n            data: [80000,  150000,   104000.7, 126000,   160000.9, 80000.2, 140000.5, 106000.6, 110000.2, 75000.3, 94000.6, 82000.8]\n        }]\n    });\n});</script>");
