$templateCache.put("app/terminos/terminos.html","<div ng-include=\"\'app/components/menu/menu.html\'\"></div><style>.T8{\n        font-weight: bold;\n        margin: 25px 0 10px 0;\n        display: block;\n        font-size: 16px;\n    }\n    .T15, .T23, .T10{\n        font-weight: bold;\n        color: #555;\n    }</style><div class=\"container center clearfix\"><h1>Términos y condiciones<br><small>www.visor.io y todos sus subdominios</small></h1><div class=\"heading-block center\"><h4 class=P40><a name=_GoBack></a><a id=a__CONTRATO_DE_PRESTACIÓN_DE_SERVICIOS_Y_DE_LOS_TÉRMINOS_Y_CONDICIONES_DE_USO_DE_LA_PLATAFORMA_ELECTRÓNICA_DE_SERVICIOS_QUE_PROVEE_VISOR_ADL__S_A_P_I__DE_C_V__EN_EL_SITIO_WEB_www_visor_io_Y_TODOS_SUS_SUBDOMINIOS_> <span></span></a>CONTRATO DE PRESTACIÓN DE SERVICIOS Y DE LOS TÉRMINOS Y CONDICIONES DE USO DE LA PLATAFORMA ELECTRÓNICA DE SERVICIOS QUE PROVEE VISOR ADL, S.A.P.I. DE C.V. EN EL SITIO WEB <a href=http://www.visor.io>www.visor.io</a> Y TODOS SUS SUBDOMINIOS.</h4></div><p class=P26><span class=T4>Este Contrato se celebra entre la empresa denominada Visor ADL, S.A.P.I. de C.V. (en lo sucesivo “VISOR”) y, “USTED” que suscribe este “Contrato” o cualquier documento que haga referencia a este “Contrato” o que acepte este “Contrato” electrónicamente o en forma tácita conforme a lo aquí previsto (en lo sucesivo “USTED”).</span></p><br><div class=\"Section1 tleft\"><div ng-controller=AccordionDemoCtrl><uib-accordion close-others=oneAtATime><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>1. Definiciones de las partes</uib-accordion-heading><uib-accordion-body><p class=P1><span class=T15>USTED</span><span class=T16>: Persona moral legalmente constituida y/o persona física con actividad empresarial que se encuentre interesada en los servicios que le haya ofrecido la empresa denominada Visor ADL, S.A.P.I. de C.V. (</span><span class=T15>VISOR</span><span class=T16>); y que hará uso del sitio web </span><a href=http://www.visor.io><span class=T2>www.visor.io</span></a><span class=T2> </span><span class=T11>y todos sus subdominios</span><span class=T16>, SIEMPRE a través de su Apoderado Legal o Representante Legal y/o persona autorizada para el caso de ser persona física con actividad empresarial, que cuente con las facultades suficientes y necesarias para: (a) Hacer uso del sitio web </span><a href=http://www.visor.io><span class=T2>www.visor.io</span></a><span class=T2> </span><span class=T11>y todos sus subdominios</span><span class=T16>; (b) Crear una cuenta de usuario y contraseña en los términos previstos en dicho sitio; (c) Compartir la información propiedad y/o bajo responsabilidad de la persona física con actividad empresarial y/o de la persona moral que represente, &nbsp;información que le será solicitada a efectos de poder proveerle de los servicios que ofrece </span><span class=T15>VISOR</span><span class=T16>; (d) Autorizar a </span><span class=T15>VISOR</span><span class=T16> para obtener información por parte de terceros que resulte necesaria, a efectos de poder proveerle de los servicios que ofrece; (e) Contratar los servicios que ofrece </span><span class=T15>VISOR</span><span class=T16> y obligarse frente a </span><span class=T15>VISOR</span><span class=T16> a cumplir con los términos y condiciones de dicha contratación; (f) Adquirir los servicios por parte de terceros de los que comercializa </span><span class=T15>VISOR</span><span class=T16> en su sitio web www.visor.io.</span></p><p class=P1><span class=T15>VISOR</span><span class=T16>: Persona moral debidamente constituida conforme a las leyes de la República Mexicana bajo la denominación social VISOR ADL, S.A.P.I. de C.V., con capacidad legal suficiente y necesaria para la celebración de este contrato; con domicilio físico en Amsterdam número 101, Colonia Hipódromo, México, D.F., Delegación Cuauhtémoc, C.P. 06100, teléfono: 55 63815214, la cual presta servicios a través del sitio web </span><a href=http://www.visor.io><span class=T2>www.visor.io</span></a><span class=T11> y todos sus subdominios</span><span class=T16>, del cual es propietario. &nbsp;</span></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>2. Objeto del Presente Contrato.</uib-accordion-heading><uib-accordion-body><p class=P26>2.1. El presente Contrato pretende regular los términos y condiciones relativos al uso que <span class=T23>“USTED”</span> haga de los productos, software y servicios que se ofrecen en el sitio web de <span class=T23>“VISOR”</span>, (en adelante, se denominarán los \"Servicios\", y queda excluido todo servicio que <span class=T23>“VISOR”</span> pueda proporcionarle en virtud de cualquier otro acuerdo celebrado por escrito); así como el uso del sitio web <a href=http://www.visor.io>www.visor.io</a> en sí y todos sus subdominios.</p><p class=P26>2.2. A menos que <span class=T23>“USTED”</span> y <span class=T23>“VISOR”</span> establezcan lo contrario por escrito, el acuerdo con <span class=T23>“VISOR” </span>siempre incluirá, como mínimo, los términos y condiciones estipulados en este contrato.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>3. Aceptación del Presente Contrato.</uib-accordion-heading><uib-accordion-body><p class=Normal_20__28_Web_29_><span class=T8>3. Aceptación del Presente Contrato.</span></p><p class=P26>3.1. Para aceptar este “Contrato”, dispone de varias posibilidades:</p><ol><li><p class=P36 style=margin-left:0cm><span style=\"display:block;float:left;min-width:    0.635cm\">A.</span>Hacer clic para aceptar dicho “Contrato”, allí donde <span class=T23>“VISOR”</span> ofrezca esta opción en la interfaz de usuario del Servicio en cuestión; o bien<span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P36 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>B.</span>Utilizar los “Servicios” en sí. En ese caso, <span class=T23>“VISOR”</span> asumirá que <span class=T23>“USTED”</span> acepta el presente “Contrato” al empezar a usar los “Servicios”; o bien<span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P36 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>C.</span>Emitir firma electrónica siguiendo el proceso que indique <span class=T23>“VISOR”</span>, a efecto de firmar el presente Contrato, haciendo constar que en el caso de que <span class=T23>“USTED”</span> acepte este procedimiento para dar su consentimiento, está consciente que la firma electrónica hará las veces de firma autógrafa, y al emitir y firmar el presente documento con la misma, estará aceptando en forma expresa todos y cada uno de los términos y condiciones previstos en el mismo.<span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P26>3.2. No podrá utilizar los “Servicios” ni aceptar este “Contrato” si no tiene la capacidad legal suficiente para poder celebrar el presente contrato, de conformidad con el Código Civil para la Ciudad de México y demás correlativos de los Estados de la República Mexicana.</p><p class=P26>3.3. Tampoco podrá utilizar los “Servicios” ni aceptar este “Contrato” si no ha recibido previamente invitación para el uso de los “Servicios” por parte de <span class=T23>“VISOR”</span>.</p><p class=P26>3.4. Antes de continuar, le recomendamos imprimir este contrato o guardar una copia del mismo en la unidad de disco local para su información.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>4. Intercambio y Eficacia de las Comunicaciones Electrónicas.</uib-accordion-heading><uib-accordion-body><p class=P26>Todas las comunicaciones que se generen, envíen, reciban, archiven o se comuniquen a través de la Plataforma de Servicios que ofrece <span class=T23>“VISOR”</span> en <a href=http://www.visor.io>www.visor.io</a> serán comunicaciones a través de medios electrónicos, y serán denominadas para efectos de este contrato y de conformidad con el Código de Comercio vigente en la República Mexicana, “Mensajes de Datos”.</p><p class=P26>Para efectos de esta cláusula se considerará Emisor a la persona que haya generado y/o enviado un “Mensaje de Datos” a la otra parte. Se considerará Destinatario a la persona que haya recibido el “Mensaje de Datos” que haya generado y/o enviado el Emisor.</p><p class=P26>Un “Mensaje de Datos” se considerará recibido por el Destinatario en el momento en que haya llegado al sistema de comunicación del Destinatario. La llegada del mensaje se da en el momento en que el mensaje entre en el primer dispositivo técnico del sistema de comunicación del destinatario. Un mensaje se considerará como entrado al sistema de comunicación del destinatario si el remitente puede dar prueba del correcto envío, a no ser que el destinatario pueda dar prueba de no haber recibido el mensaje. Se considerará como sistema de comunicación la totalidad de aparatos técnicos y medios, particularmente el hardware y software, de los cuales haga uso <span class=T23>“USTED”</span> para la realización del intercambio de mensajes electrónicos necesarios para proveer y hacer uso de los “Servicios”.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>5. Provisión de los “Servicios” por parte de “VISOR”: Obligaciones a cargo de “VISOR”</uib-accordion-heading><uib-accordion-body><p class=P26>5.1. Como parte de los “Servicios”, <span class=T23>“VISOR”</span> proporcionará a <span class=T23>“USTED”</span> herramientas de gestión y análisis financieros que le permitirán determinar los mejores productos financieros disponibles en el mercado para fortalecer su negocio.</p><p class=P26>5.2. Con la información que <span class=T23>“USTED”</span> comparta a <span class=T23>“VISOR”</span> en términos de lo previsto en las Políticas de Privacidad que estarán disponibles en el sitio web www.visor.io; <span class=T23>“VISOR”</span> realizará un análisis de datos a efecto de crearle un Perfil que nos permita detectar las mejores opciones en el mercado crediticio para contribuir al desarrollo óptimo de su negocio (en lo sucesivo el <span class=T3>“Perfil”</span>).</p><p class=P26>5.3. <span class=T23>“VISOR”</span> será una unidad de enlace entre <span class=T23>“USTED”</span> y la Institución Financiera que mejor se adapte a sus necesidades, guiándolo en el proceso de solicitud y contratación de un producto financiero y/o crediticio. Es importante que <span class=T23>“USTED”</span> esté consciente que <span class=T23>“VISOR”</span> NO otorga créditos, sólo funge como intermediario entre la Institución Financiera de que se trate y <span class=T23>“USTED”</span>.</p><p class=P26>5.4. <span class=T23>“VISOR”</span> coordinará las relaciones de <span class=T23>“USTED”</span> con la Institución Financiera con la que <span class=T23>“USTED”</span> decida contratar un crédito; de tal manera que se logre mayor eficiencia en esta contratación.</p><p class=P26>5.5. Una vez que <span class=T23>“USTED”</span> contrate un crédito con la Institución Financiera respectiva, <span class=T23>“VISOR”</span> lo apoyará en agilizar los pagos de dicho crédito, al ofrecerle el acceso a una plataforma de re-direccionamiento de pagos operada por un tercero bajo la infraestructura de Banco de México. Este servicio ofrecerá la creación de una cuenta virtual mediante la cual se recibirán los pagos por parte de sus clientes (empresas con las cuales <span class=T23>“USTED”</span> tenga relación de proveedor-cliente y a las cuales <span class=T23>“USTED”</span> deberá instruir para que depositen las cantidades respectivas en la cuenta virtual), y se canalizarán las cantidades adeudadas a la Institución Financiera de que se trate y las cantidades restantes le serán transferidas a la cuenta bancaria de su propiedad que <span class=T23>“USTED”</span> nos indique. &nbsp;Esto se regulará de conformidad con el <span class=T3>Anexo 1</span> del presente Contrato.</p><p class=P26>5.6. La página web <a href=http://www.visor.io>www.visor.io</a> y sus subdominios, contendrá imágenes y/o descripciones de los “Servicios”.</p><p class=P26>5.7. <span class=T23>“USTED”</span> reconoce y acepta que, si bien <span class=T23>“VISOR”</span> puede no haber fijado ningún límite en cuanto al número de transmisiones para enviar o recibir elementos a través de los “Servicios” ni tampoco en la cantidad de espacio de almacenamiento disponible para la provisión de cualquiera de los “Servicios”, <span class=T23>“VISOR”</span> se reserva el derecho de establecer límites al respecto en cualquier momento y a su absoluta discreción.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>6. Uso de los “Servicios”: Obligaciones a cargo de “USTED”.</uib-accordion-heading><uib-accordion-body><p class=P26><span class=T25>6.1. El uso de los “Servicios” implica la obligación de respetar este Contrato, sus anexos y las Políticas de Privacidad, que forman parte integral de este documento y están publicadas en el sitio web www.visor.io. Una vez que </span><span class=T24>“USTED”</span><span class=T25> contrate un Producto Financiero y/o Crediticio, su relación estará sujeta en forma adicional al presente documento, a las condiciones, contraprestaciones y términos del Contrato que </span><span class=T24>“USTED”</span><span class=T25> celebre con la Institución Financiera respectiva. </span><span class=T24>“VISOR”</span><span class=T25> no formará parte del Contrato recién descrito, ni tendrá responsabilidad alguna al respecto.</span></p><p class=P26><span class=T26>6.2. </span><span class=T27>El uso de los “Servicios” podrá generar la obligación de pagar determinada contraprestación, la cual le será indicada al momento de acceder al uso de los “Servicios”, o vía correo electrónico. Si </span><span class=T28>“USTED”</span><span class=T27> no recibe indicación alguna de pago y tarifas respectivas por estos medios, el uso de los “Servicios” no generará obligación de pago alguna</span><span class=T26>.</span></p><p class=P26><span class=T25>6.3. Para acceder al uso de los “Servicios”, deberá ingresar el Registro Federal de Contribuyentes (RFC) de </span><span class=T24>“USTED”</span><span class=T25>, de conformidad con el término definido en el capítulo de definiciones del presente documento. Una vez introducido el RFC de</span><span class=T24> “USTED”</span><span class=T25> (de conformidad con el término definido en el capítulo de definiciones del presente documento) al sistema, </span><span class=T24>“VISOR”</span><span class=T25> revisará que </span><span class=T24>“USTED”</span><span class=T25> haya recibido previamente invitación para la utilización de los “Servicios”; de ser así, se le dará acceso para la creación de una cuenta de usuario y una contraseña (en lo sucesivo la “Contraseña para Acceso Plataforma VISOR”).</span></p><p class=P26>6.4. Durante el uso de los “Servicios”, se le solicitará y <span class=T23>“USTED”</span> deberá proporcionar información de su propiedad y/o bajo su responsabilidad, dentro de la cual es posible que se encuentren datos personales, tales como datos identificativos e información de contacto, como parte del proceso de registro en el Servicio o como parte del uso continuado de los “Servicios”. <span class=T23>“USTED”</span> se compromete a que cualquier información tanto de registro como aquella que proporcione a <span class=T23>“VISOR”</span> durante el uso de los “Servicios” será precisa, correcta y actual. El uso de la información que <span class=T23>“USTED”</span> nos proporcione estará regulado conforme a lo previsto en la cláusula octava del presente documento.</p><p class=P26>6.5. Así mismo para el uso de los “Servicios”, y a efecto de <span class=T30>realizar un análisis preciso y adecuado de sus datos, y así crear el </span><span class=T5>“Perfil”</span><span class=T30>,</span> será necesario que <span class=T23>“USTED”</span> nos comparta la Contraseña (antes conocida como CIEC) la cual da acceso a información por parte del Servicio de Administración Tributaria (SAT). Es indispensable para que <span class=T23>“VISOR”</span> pueda prestar los “Servicios” que <span class=T23>“USTED”</span> no modifique esta Contraseña (antes CIEC) durante la vigencia del presente Contrato.</p><p class=P26><span class=T23>6.6. </span>Para el uso de los servicios descritos en el Anexo 1,<span class=T23> “USTED”</span> deberá instruir a la empresa con la cual tenga relación de proveedor-cliente y la cual le adeude las cantidades por concepto de servicios con las cuales se pagarán los productos financieros y/o crediticios que USTED haya contratado; para que depositen las cantidades respectivas en la cuenta virtual que se creará conforme a los dispuesto en el Anexo 1.</p><p class=P26><span class=T6>6.7. </span><span class=T12>“USTED”</span><span class=T6> sabe y está consciente de que para el suministro del servicio es necesaria la intervención de terceros que pueden ser nacionales y/o extranjeros, tales como proveedores del servicio de Internet, propietarios de equipos y/o servicios de acceso a Internet, administradores de sitios de hospedaje, entre otros.</span></p><p class=P26>6.8. <span class=T23>“USTED”</span> acepta utilizar los Servicios exclusivamente con los fines estipulados en este Contrato y en cumplimiento a cualquier ley o regulación aplicable o cualquiera de las prácticas o directrices aceptadas en las jurisdicciones pertinentes, incluida cualquier ley relativa a la exportación de datos o software a, o desde los Estados Unidos de América o cualquier país pertinente.</p><p class=P26>6.9. <span class=T23>“USTED”</span> se compromete a no acceder ni a intentar acceder a ninguno de los Servicios por ningún otro medio que no sea la interfaz provista por <span class=T23>“VISOR”</span>, a menos que así se haya establecido en un acuerdo por escrito independiente entre <span class=T23>“USTED”</span> y <span class=T23>“VISOR”</span>. Se compromete en concreto a no acceder, o intentar acceder, a ninguno de los Servicios utilizando medios automatizados, incluidos secuencias de comandos o rastreadores web, y se asegurará de cumplir las instrucciones dispuestas en este documento, en las Políticas de Privacidad y en el sitio web <a href=http://www.visor.io>www.visor.io</a> <span class=T13>y en todos sus subdominios</span>. &nbsp;Así mismo, <span class=T23>“USTED”</span> se compromete a no involucrarse en ninguna actividad que interfiera o que interrumpa los Servicios o los servidores y redes conectados a aquellos.</p><p class=P26>6.10. A menos que se estipule lo contrario en un acuerdo independiente entre <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span>, éste último se compromete a no reproducir, duplicar, copiar, vender, comercializar ni revender los Servicios para ningún fin.</p><p class=P26>6.11. Por el presente “Contrato”, <span class=T23>“USTED”</span> acepta que es el único responsable, y que <span class=T23>“VISOR”</span> renuncia a toda responsabilidad hacia <span class=T23>“USTED”</span> o hacia cualquier tercero, del incumplimiento de cualquiera de sus obligaciones en virtud del presente contrato, así como de las consecuencias, incluido cualquier pérdida o daño que pueda ocasionar a <span class=T23>“VISOR”</span>, derivado de dicho incumplimiento.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>7. Contraseñas y Seguridad de la Cuenta.</uib-accordion-heading><uib-accordion-body><p class=P26>7.1. Por el presente contrato, <span class=T23>“USTED”</span> reconoce y acepta que es el único responsable de que la persona que cree la “Contraseña para Acceso Plataforma Visor” cumpla con la definición de <span class=T23>“USTED”</span> prevista al inicio de este documento; esto es, que cuente con las facultades suficientes y necesarias para obligarse en términos del presente contrato. En el supuesto de que la “Contraseña para Acceso Plataforma Visor” sea creada por persona distinta a la antes descrita, <span class=T23>“USTED”</span> responderá de los daños y/o perjuicios que esto cause y deberá sacar en paz y a salvo a <span class=T23>“VISOR”</span> de cualquier controversia al respecto.</p><p class=P26>7.2. <span class=T23>“USTED”</span> será el único responsable de mantener la confidencialidad de la “Contraseña para Acceso Plataforma VISOR” y/o claves de acceso asociadas a cualquiera de las cuentas que podría llegar a utilizar para acceder a los “Servicios”.</p><p class=P26>7.3. En consecuencia, acepta que <span class=T23>“USTED”</span> será el único responsable ante <span class=T23>“VISOR”</span> de todas y cada una de las actividades que se desarrollen en su cuenta.</p><p class=P26>7.4. <span class=T23>“USTED”</span> está consciente que las personas que autorice para actuar en su cuenta deberán estar debidamente facultadas y autorizadas. Por lo que en el supuesto de que estas personas dejen de laborar para <span class=T23>“USTED”</span> y/o ya no cuenten con las facultades o autorizaciones necesarias para actuar en su nombre y representación, <span class=T23>“USTED”</span> será responsable de realizar las modificaciones necesarias, a efecto de evitar un mal uso de su cuenta.</p><p class=P26>7.5. <span class=T23>“USTED”</span> acepta notificar de inmediato a <span class=T23>“VISOR”</span> de cualquier uso no autorizado de su contraseña o cuenta de que tenga conocimiento, a través de la dirección: <a href=mailto:contact@visor.io>contact@visor.io</a><span class=T31>.</span></p><p class=P26><span class=T6>7.6. </span><span class=T12>“USTED”</span><span class=T6> acepta que es el único responsable de cuidar que su cuenta sea creada por persona debidamente facultada para tal efecto, conforme a lo definido para el término </span><span class=T12>“USTED”</span><span class=T6> en la cláusula primera de este documento. De crearse una cuenta por persona no facultada, </span><span class=T12>“USTED”</span><span class=T6> deberá sacar en paz y a salvo a </span><span class=T12>“VISOR”</span><span class=T6> de cualquier controversia al respecto, y, en su caso, cubrir el pago de daños y/o perjuicios que esto ocasione a </span><span class=T12>“VISOR”</span><span class=T6>.</span></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>8. Información y Privacidad.</uib-accordion-heading><uib-accordion-body><p class=P26>8.1. Para obtener información acerca de las prácticas de protección de datos personales y de información en general que aplica <span class=T23>“VISOR”</span>, consulte nuestra <span class=T23>Política de privacidad</span> para tratamiento de la información en general y <span class=T23>Aviso de Privacidad</span> para tratamiento de datos personales en este sitio. Estas políticas explican el tratamiento que hace <span class=T23>“VISOR”</span> de su información y cómo protege su privacidad cuando utiliza los “Servicios”. El Aviso de Privacidad explica la forma en que serán tratados los datos personales que pudiera llegar a recabar directamente <span class=T23>“VISOR”</span> por el uso que <span class=T23>“USTED”</span> haga de los “Servicios”.</p><p class=P26>8.2. Por su parte, <span class=T23>“USTED”</span> acepta el uso de su información de acuerdo con las <span class=T23>Políticas de Privacidad</span> de <span class=T23>“VISOR”</span>.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>9. Venta de Servicios de Terceros.</uib-accordion-heading><uib-accordion-body><p class=P26>Dentro de la Plataforma de <span class=T23>“VISOR”</span>, éste último podrá comercializar servicios de terceros, para lo cual se aplicarán las contraprestaciones previstas ahí en el lugar dentro del sitio <a href=http://www.visor.io>www.visor.io</a>, donde se ofrezcan dichos servicios. <span class=T23>“USTED”</span> tendrá la opción de aceptar o no aceptar dichos servicios. Estos servicios serán proporcionados directamente por dichos terceros, por lo que <span class=T23>“VISOR”</span> sólo fungirá como un revendedor, más no tendrá en ningún caso responsabilidad alguna en la ejecución y prestación de dichos servicios.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>10. Contenido de los Servicios.</uib-accordion-heading><uib-accordion-body><p class=P26>10.1. El Contenido ofrecido como parte de los “Servicios”, está protegido por derechos de propiedad intelectual debidamente registrados, pertenecientes ya sea a <span class=T23>“VISOR”</span> y/o a las personas que facilitan dicho Contenido a <span class=T23>“VISOR”</span>. Se hace constar que los derechos de propiedad intelectual de la “Página de Internet www.visor.io” es propiedad única y exclusiva de <span class=T23>“VISOR”</span>. A menos que <span class=T23>“VISOR”</span> o los propietarios del mencionado Contenido autoricen expresamente lo contrario en un acuerdo independiente, <span class=T23>“USTED”</span> se compromete a no modificar, alquilar, arrendar, prestar, vender ni distribuir este Contenido, ni crear trabajos derivados basados en él, ya sea en su totalidad o en parte.</p><p class=P26>10.2. <span class=T23>“USTED”</span> acepta que es el único responsable, y que <span class=T23>“VISOR”</span> renuncia a toda responsabilidad hacia <span class=T23>“USTED”</span> o hacia cualquier tercero, de todo el Contenido que cree, transfiera o publique durante el uso y/o haciendo uso de los Servicios, así como de las consecuencias derivadas de sus acciones, incluido cualquier pérdida o daño que ocasione a <span class=T23>“VISOR”</span>.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>11. Derechos sobre la Propiedad.</uib-accordion-heading><uib-accordion-body><p class=P26>11.1. Por el presente Contrato, <span class=T23>“USTED”</span> acepta que <span class=T23>“VISOR”</span>, o sus proveedores de licencias, es el propietario de todos los derechos, títulos e intereses asociados a los Servicios, incluidos todos los derechos sobre la propiedad intelectual que actúen sobre ellos, independientemente de si los mencionados derechos están registrados o no y de donde existan. Asimismo, <span class=T23>“USTED”</span> reconoce que los Servicios pueden contener información considerada confidencial por <span class=T23>“VISOR”</span> y se compromete a no revelar dicha información sin el consentimiento previo y por escrito de <span class=T23>“VISOR”</span>.</p><p class=P26>11.2. A menos que <span class=T23>“USTED”</span> acuerde lo contrario por escrito con <span class=T23>“VISOR”</span>, ninguna de las disposiciones del presente Contrato le otorga el derecho a usar los nombres y las marcas comerciales de <span class=T23>“VISOR”</span>, sus marcas de servicio, marcas de producto, logotipos, avisos comerciales, nombres de dominio u otras características distintivas materia de propiedad industrial.</p><p class=P26>11.3. En caso de que se le conceda el derecho explícito a utilizar alguna de estas características de marca a través de un acuerdo por escrito e independiente entre <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span>, éste último se compromete a que el uso de dichas características cumpla con el acuerdo en cuestión, con cualquiera de las disposiciones aplicables de este Contrato y con las directrices de uso de los elementos de marca de <span class=T23>“VISOR”</span>, las cuales podrán modificarse periódicamente.</p><p class=P26>11.4. <span class=T23>“USTED”</span> acepta no eliminar, ocultar ni alterar los avisos de derechos sobre la propiedad, entre ellos, avisos de derechos de autor y de marcas registradas, tanto los incluidos en los Servicios como los que se facilitan como parte de estos.</p><p class=P26>11.5. Salvo que <span class=T23>“VISOR”</span> le haya concedido la autorización expresamente por escrito, <span class=T23>“USTED”</span> se compromete a que, durante el uso de los “Servicios”, no utilizará ninguna marca comercial, marca de servicio, marca de producto, aviso comercial, nombre comercial o logotipo de ninguna empresa u organización en modo alguno que ocasionara confusión sobre el propietario o usuario autorizado de dichas marcas, nombres o logotipos.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>12. Licencia de USO de “VISOR”.</uib-accordion-heading><uib-accordion-body><p class=P26>12.1. <span class=T23>“VISOR”</span> le concede una licencia de USO personal, internacional y no exclusiva, que no está sujeta a derechos de autor y que sólo puede asignarse, para utilizar el software proporcionado por <span class=T23>“VISOR” </span>como parte de los Servicios (en adelante, el \"Software\"). Esta licencia se otorga con el único propósito de permitirle utilizar los Servicios que le ofrece <span class=T23>“VISOR”</span> y beneficiarse de ellos según lo estipulado en este Contrato.</p><p class=P26>12.2. Queda prohibido copiar, modificar, descompilar o intentar extraer el código fuente del Software total o parcialmente, o crear trabajos derivados o realizar ingeniería inversa de este, así como permitir que un tercero lo haga, a menos que así lo permita o exija la ley, o a menos que <span class=T23>“VISOR”</span> le conceda tales derechos por escrito.</p><p class=P26>12.3. A menos que <span class=T23>“VISOR”</span> le haya concedido el permiso por escrito, no podrá asignar ni conceder sublicencias de sus derechos para utilizar el Software, conceder intereses sobre la seguridad en cuanto a estos derechos ni transferir ninguno de tales derechos.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>13. Actualizaciones de Software.</uib-accordion-heading><uib-accordion-body><p class=P26>13.1. El Software que se utiliza para la prestación de los “Servicios” materia del presente contrato, podrá descargar e instalar automáticamente actualizaciones de <span class=T23>“VISOR”</span>. Dichas actualizaciones están diseñadas para mejorar, optimizar y desarrollar los “Servicios” y pueden presentarse en forma de correcciones, funciones mejoradas, nuevos módulos de software y versiones totalmente nuevas. <span class=T23>“USTED”</span> acepta recibir dichas actualizaciones, y permite a <span class=T23>“VISOR”</span> proporcionárselas, como parte de estos Servicios.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>14. Finalización de la Relación con VISOR.</uib-accordion-heading><uib-accordion-body><p class=P26>14.1. Las condiciones establecidas en el presente Contrato seguirán vigentes hasta que <span class=T23>“VISOR”</span> o usted decida darlas por terminadas, según lo estipulado a continuación.</p><p class=P26>14.2. El Contrato se mantendrá vigente mientras <span class=T23>“USTED”</span> tenga obligaciones pendientes de pago con la institución financiera con quien haya contratado un producto financiero y/o crediticio; a menos que el mismo sea terminado o rescindido en los términos siguientes.</p><p class=P26>14.3. Las Partes de común acuerdo y por escrito podrán dar por terminado el presente Contrato.</p><p class=P26>14.4. <span class=T23>“USTED”</span> podrá dar por terminado, sin causa alguna, el presente acuerdo establecido con <span class=T23>“VISOR”</span> siempre que dicha terminación se realice antes de haber emitido una solicitud para un producto financiero y/o crediticio a la Institución Financiera respecto de la cual <span class=T23>“VISOR”</span> funge como enlace. Ante tal supuesto, <span class=T23>“USTED”</span> deberá cerrar las cuentas de todos los Servicios de los que hace uso, allí donde <span class=T23>“VISOR”</span> le ofrezca la opción. Así mismo, <span class=T23>“USTED”</span> deberá enviar un correo electrónico a la siguiente dirección: <a href=mailto:contact@visor.io>contact@visor.io</a>, indicando las razones de la terminación de sus servicios. Posterior a esta notificación <span class=T23>“USTED”</span> recibirá un correo electrónico por parte de <span class=T23>“VISOR”</span> indicándole el cierre de sus cuentas.</p><p class=P26>14.5. <span class=T23>“USTED”</span> podrá rescindir el presente contrato establecido con <span class=T23>“VISOR”</span> en cualquier momento si:</p><ol><li><p class=P27 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(A)</span><span class=T23>“VISOR”</span> ha incumplido con las obligaciones a su cargo previstas en el presente contrato.<span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P26>14.6. <span class=T23>“VISOR”</span> podrá rescindir el presente contrato establecido con <span class=T23>“USTED”</span> en cualquier momento si:</p><ol><li><p class=P28 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(A)</span><span class=T23>“USTED”</span> ha incumplido alguna de las disposiciones previstas en el presente Contrato, en cualquiera de sus Anexos o en las Políticas de Privacidad o ha actuado de algún modo que demuestre que no tiene intención de cumplir tales disposiciones o que no puede cumplirlas. <span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P28 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(B)</span><span class=T23>“USTED”</span> ha modificado su Contraseña (antes CIEC) haciendo imposible para <span class=T23>“VISOR”</span> el proveerle los servicios de análisis de datos y ocasionando con esto que <span class=T23>“VISOR”</span> incumpla sus contratos de servicios con instituciones financieras y/o con otros terceros con quienes contrata a efecto de lograr proveer los “Servicios”.<span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P28 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(C)</span><span class=T23>“USTED”</span> ha modificado las instrucciones de pago dirigidas a las empresas con las cuales <span class=T23>“USTED”</span> tiene una relación proveedor-cliente, ocasionando con esto que los pagos no sean transferidos a la cuenta virtual creada para recibir los servicios de re-direccionamiento de pagos, situación que traerá como consecuencia la imposibilidad de <span class=T23>“VISOR”</span> de proveerle los servicios de re-direccionamiento de pagos y el incumplimiento de sus contratos de servicios con instituciones financieras. <span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P28 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(D)</span>Así se lo exige a <span class=T23>“VISOR”</span> la ley, por ejemplo, en caso de que por nuevas disposiciones legales la provisión de los “Servicios” no sea permitida.<span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P26>En cualquiera de los supuestos anteriores, <span class=T23>“VISOR”</span> ya no tendrá obligación alguna de proveerle los servicios aquí pactados, y <span class=T23>“USTED”</span> quedará obligado a pagar las cantidades adeudadas a <span class=T23>“VISOR”</span> por los servicios prestados y seguirá obligado directamente con la(s) institución(es) financiera(s) con las que usted haya contratado productos financieros y/o créditos, liberando a <span class=T23>“VISOR”</span> de cualquier responsabilidad al respecto.</p><p class=P26>14.7. Cuando este Contrato se rescinda, todos los derechos, las obligaciones y las responsabilidades legales por las que <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span> se hayan regido, las que hayan acumulado durante la vigencia de las Condiciones o que continúen vigentes indefinidamente quedarán inalteradas.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>15. Exclusión de Garantías.</uib-accordion-heading><uib-accordion-body><p class=P26>15.1. <span class=T23>“USTED”</span> manifiesta y admite expresamente que el uso del servicio se realiza bajo su propia responsabilidad y que el servicio se suministra “tal cual” y en función de su disponibilidad.</p><p class=P26>15.2. En concreto, <span class=T23>“VISOR”</span>, sus proveedores de licencias<span class=T6> y los “terceros” que intervienen en el suministro del servicio,</span> no garantizan que:</p><ol><li><p class=P29 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(A)</span>El uso que <span class=T23>“USTED”</span> haga de los servicios se ajuste a sus necesidades específicas.<span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P29 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(B)</span>Los servicios se proporcionen en forma ininterrumpida, precisa, segura y/o sin errores.<span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P29 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(C)</span>La información que obtenga<span class=T23> “USTED”</span> como consecuencia del uso de los servicios sea exacta y/o fiable; en virtud de que <span class=T23>“VISOR”</span> no tiene manera de cerciorarse de que la información que obtenga de <span class=T23>“USTED”</span> por parte de terceros es exacta, correcta y fiable.<span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P29 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(D)</span>Se corregirán los defectos de funcionamiento y operatividad de cualquier software que se proporcione como parte de los servicios.<span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P26>15.3. Todo material descargado u obtenido por cualquier otro medio a través del uso de los servicios corre a cuenta y riesgo de <span class=T23>“USTED”</span>, y éste último será el único responsable de cualquier daño y/o perjuicio ocasionado en su sistema informático o en el sistema informático propiedad de <span class=T6>“terceros”</span> a través del cual utilice los servicios; así como cualquier daño y/o perjuicio causado a cualquier otro dispositivo, así como de la pérdida de datos, que pueda resultar de la descarga de dicho material.</p><p class=P26>15.4. &nbsp;Ningún tipo de notificación ni información, ya sea oral o escrita, obtenida por <span class=T23>“VISOR”</span> acerca de <span class=T23>“VISOR”</span> y/o de los Servicios, o mediante éstos últimos, creará garantías o derechos distintos a los expresamente mencionados en el presente documento.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>16. Limitación de Responsabilidades.</uib-accordion-heading><uib-accordion-body><p class=P26>16.1. <span class=T23>“VISOR”</span> no será responsable ante <span class=T23>“USTED”</span> por:</p><ol><li><p class=P30 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(A)</span>Ningún daño y/o perjuicio directo, indirecto, fortuito, especial causado a <span class=T23>“USTED”</span>, sea cual sea su causa, esto incluye, en forma enunciativa más no limitativa, cualquier pérdida de beneficios sea directa y/o indirecta, cualquier pérdida de prestigio profesional o reputación empresarial, cualquier pérdida de datos, gastos por bienes o servicios u otras pérdidas tangibles y/o intangibles. <span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P30 style=margin-left:0cm><span style=display:block;float:left;min-width:0.635cm>(B)</span>Ningún daño y/o perjuicio causado a <span class=T23>“USTED”</span> como consecuencia de:<span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P37 style=margin-left:2.251cm><span style=display:block;float:left;min-width:1.27cm>(I)</span>Los cambios que <span class=T23>“VISOR”</span> pueda incorporar en los Servicios o la interrupción temporal o definitiva de éstos o de alguna de sus funciones;<span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P37 style=margin-left:2.251cm><span style=display:block;float:left;min-width:1.27cm>(II)</span>La creación falsa o por persona no autorizada de su cuenta;<span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P37 style=margin-left:2.251cm><span style=display:block;float:left;min-width:1.27cm>(III)</span>La negligencia por no haber preservado, en su caso, la “Contraseña para acceso a la Plataforma Visor” o la información de su cuenta de forma segura y confidencial.<span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P26>16.2. Las limitaciones de responsabilidad aquí pactadas, serán aplicables independientemente de si se le han notificado tales posibilidades de daños y/o perjuicios a <span class=T23>“VISOR”</span> o de si <span class=T23>“VISOR”</span> debería haber sido consciente de dicha posibilidad.</p><p class=P32>&nbsp;</p><p class=Normal_20__28_Web_29_><span class=T32>17. Otros contenidos.</span></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>17. Otros contenidos.</uib-accordion-heading><uib-accordion-body><p class=P26>17.1. Los “Servicios” podrán incluir hipervínculos a otros sitios, contenido o recursos de Internet. <span class=T23>“VISOR”</span> no ejerce ningún control sobre los recursos y sitios web que proporcionen terceros ajenos a <span class=T23>“VISOR”</span>, y se estará a lo previsto en las Políticas de Privacidad que forman parte integral de este documento y se encuentran disponibles en el sitio de internet www.visor.io.</p><p class=P26>17.2. <span class=T23>“USTED”</span> reconoce y acepta que <span class=T23>“VISOR”</span> no se responsabiliza de la disponibilidad de dichos sitios web o recursos externos y que no respalda la publicidad, productos u otros materiales proporcionados en los sitios web o recursos en cuestión o a través de ellos, ni es responsable de ellos.</p><p class=P26>17.3. <span class=T23>“USTED”</span> reconoce y acepta que <span class=T23>“VISOR”</span> no se responsabiliza de ninguna de las pérdidas, daños y/o perjuicios en que <span class=T23>“USTED”</span> pueda incurrir como consecuencia de la disponibilidad de dichos sitios web o recursos externos o como consecuencia de la confianza que <span class=T23>“USTED”</span> deposite en la veracidad, precisión o existencia de publicidad, productos u otros materiales proporcionados en los sitios web o recursos en cuestión o a través de ellos.</p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>18. Cambios en las Condiciones.</uib-accordion-heading><uib-accordion-body><p></p><p class=P26>18.1. <span class=T23>“VISOR”</span> podrá incorporar cambios en el presente Contrato, según considere oportuno. En ese caso, <span class=T23>“VISOR”</span> incluirá la nueva versión del mismo en el “Sitio de Internet www.visor.io” y proporcionará los Términos y Condiciones adicionales en los Servicios correspondientes o a través de estos.</p><p class=P26>18.2. <span class=T23>“USTED”</span> reconoce y acepta qué si utiliza los “Servicios” después de haberse incorporado los cambios pertinentes en este Contrato y/o en los términos y condiciones de los Servicios, esto implicará una aceptación.</p><p></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>19. Condiciones legales generales.</uib-accordion-heading><uib-accordion-body><p class=P26>19.1. El presente documento, las Políticas de Privacidad y sus anexos, en su caso, constituyen el acuerdo legal completo entre <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span>, rigen el uso que <span class=T23>“USTED”</span> haga de los “Servicios”, sin incluir los servicios que <span class=T23>“VISOR”</span> le ofrezca en virtud de un acuerdo por escrito independiente, y sustituyen cualquier acuerdo previo entre <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span> relativo a los “Servicios”.</p><p class=P26>19.2. <span class=T23>“USTED”</span> acepta que <span class=T23>“VISOR”</span> puede proporcionarle avisos, incluidos los relativos a los cambios a este documento y sus anexos, a través de la dirección de correo electrónico que proporcione o mediante su publicación en la “Página de Internet www.visor.io”.</p><p class=P26>19.3. <span class=T23>“USTED”</span> acepta que, si <span class=T23>“VISOR”</span> no ejerce ningún derecho de los estipulados en el presente documento y sus anexos o de los que <span class=T23>“VISOR”</span> pueda beneficiarse en virtud de alguna ley aplicable, se interpretará como que ello no supone una renuncia legal de los derechos a favor de <span class=T23>“VISOR”</span>.</p><p class=P26>19.4. Si un tribunal, con la jurisdicción competente para decidir sobre este asunto, dicta sentencia en virtud de la cual declare nula alguna de las disposiciones, artículos o cláusulas de este documento y/o sus anexos, dicha disposición, artículo o cláusula se eliminará del presente documento y/o sus anexos sin que ello afecte al resto de las disposiciones, artículos o cláusulas aquí contenidas. El resto de las disposiciones, artículos o cláusulas seguirán siendo válidas y vigentes.</p><p class=P26>19.5. Las Condiciones de servicio y la relación surgida entre <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span> en virtud del presente documento y sus anexos se regirán por las leyes aplicables en la Ciudad de México. <span class=T23>“VISOR”</span> y <span class=T23>“USTED”</span> aceptan someterse a la jurisdicción exclusiva de los tribunales de la Ciudad de México para resolver cualquier asunto legal derivado de estas Condiciones.</p></uib-accordion-body></div></uib-accordion></div></div><p class=P6></p><h1 class=T20>ANEXO 1</h1><p></p><p class=P7><span class=T18>Servicios de Re-direccionamiento de Pagos</span></p><a id=a__Este_Anexo_1_forma_parte_integral_del_CONTRATO_DE_PRESTACIÓN_DE_SERVICIOS_Y_DE_LOS_TÉRMINOS_Y_CONDICIONES_DE_USO_DE_LA_PLATAFORMA_ELECTRÓNICA_DE_SERVICIOS_QUE_PROVEE_VISOR_ADL__S_A_P_I__DE_C_V__EN_EL_SITIO_WEB_www_visor_io_Y_TODOS_SUS_SUBDOMINIOS_><span></span></a><p>Este Anexo 1 forma parte integral del</p><p class=T2>CONTRATO DE PRESTACIÓN DE SERVICIOS Y DE LOS TÉRMINOS Y CONDICIONES DE USO DE LA PLATAFORMA ELECTRÓNICA DE SERVICIOS QUE PROVEE VISOR ADL, S.A.P.I. DE C.V. EN EL SITIO WEB <a href=http://www.visor.io><span class=T2>www.visor.io</span></a><span class=T2> Y TODOS SUS SUBDOMINIOS.</span></p><p>Objeto: Este Anexo rige los términos por los cuales “USTED” puede usar los servicios de Re-direccionamiento de Pagos que son accesibles a través del sitio web de VISOR y otras aplicaciones. Al ingresar y usar el servicio, usted manifiesta su consentimiento con el presente Anexo, en los términos y condiciones siguientes.</p><uib-accordion close-others=oneAtATime><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Información General de Servicio.</uib-accordion-heading><uib-accordion-body><ol><li><p class=P9 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>a.</span><span class=T36>Propósito</span><span class=T35>. El propósito del Servicio es que “USTED” obtenga el beneficio de realizar los pagos que adeude a instituciones financieras mediante el cobro ágil de facturas que “USTED” tenga a su favor. </span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P9 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>b.</span><span class=T36>Horario del Servicio</span><span class=T35>: El servicio estará disponible de las 9:00 a las 17:00 horas tiempo de la Ciudad de México. De realizar transacciones fuera del horario asignado, estas serán programadas para el día hábil siguiente.</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P9 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>c.</span><span class=T36>Usuarios</span><span class=T35>. Para efectos prácticos de este servicio, los usuarios del mismo, serán definidos conforme a lo siguiente:</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P11><span class=T37>REMITENTE:</span><span class=T35>&nbsp; Es la empresa que utiliza el servicio para realizar los pagos de facturas adeudadas a </span><span class=T38>“USTED”</span><span class=T35>.</span></p><p class=P11><span class=T37>DESTINATARIO:</span><span class=T35>&nbsp; Es una persona física con actividad empresarial y/o moral que recibe dinero de parte de un </span><span class=T36>REMITENTE</span><span class=T35>, a través del Servicio. El </span><span class=T36>DESTINATARIO</span><span class=T35> puede ser </span><span class=T38>“USTED”</span><span class=T35> y/o el </span><span class=T36>BENEFICIARIO</span><span class=T35>.</span></p><p class=P11><span class=T37>BENEFICIARIO:</span><span class=T35>&nbsp;Es una institución financiera que recibe pagos parciales y/o totales derivados de un contrato de crédito, donde el Acreditado podría ser </span><span class=T36>USTED.</span></p><ol><li><p class=P9 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>d.</span><span class=T36>Definición de Términos utilizados en este Acuerdo.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P11><span class=T37>TRANSACCIÓN</span><span class=T35>&nbsp;es una instrucción específica de enviar dinero por medio del servicio.</span></p><p class=P11><span class=T36>MONTO DE LA TRANSACCIÓN</span><span class=T35> es la cantidad de dinero que el </span><span class=T36>REMITENTE</span><span class=T35> entrega a través de VISOR.</span></p><p class=P11><span class=T36>MONTO A PAGAR</span><span class=T35>&nbsp;es la cantidad de dinero que se paga al Destinatario.</span></p><p class=P11><span class=T36>CUENTA CLABE</span><span class=T35>. Para el uso de este servicio, se requiere crear una cuenta virtual a la cual se le asignará una CLABE (Clave Bancaria Estandarizada), para efectos de poder realizar las transferencias electrónicas. </span><span class=T16>Usted, en calidad de Destinatario, deberá instruir a su Remitente para que los pagos que le adeude los realice a la cuenta CLABE respectiva. Durante el período de vigencia del presente Contrato </span><span class=T15>“USTED”</span><span class=T16> no deberá modificar las instrucciones de pago dirigidas a su Remitente.</span></p></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Ejemplo de Transición.</uib-accordion-heading><uib-accordion-body><p class=P4>&nbsp;</p><p class=P1><span class=T16>Con la finalidad de clarificar la forma en que se llevarán a cabo los servicios de re-direccionamiento de pagos, exponemos a continuación un ejemplo, al Remitente se le llamará “Empresa Tractor” sólo para este ejemplo:</span></p><ol><li><ol><li><p class=P13 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>a.</span><span class=T18>Proceso</span><span class=T16>. 1.- Visor genera la cuenta CLABE virtual asignada a tu empresa. 2.- Empresa Tractor registra la Cuenta CLABE Virtual asignada a tu empresa para realizar pagos. 3.- La Empresa Tractor realiza el pago de una factura.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol></li></ol><!--Next \'div\' was a \'text:p\'.--><div class=P18><!--Next \'\n                                span\' is a draw:frame.\n                            --> <span style=\"height:8.387cm;width:14.711cm; padding:0\" class=fr1 id=Imagen_1><img style=height:8.387cm;width:14.711cm alt=\"\" src=\"data:image/*;base64,\"></span></div><div style=\"clear:both; line-height:0; width:0; height:0; margin:0; padding:0\">&nbsp;</div><ol><li><ol><li><p class=P15 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>b.</span><span class=T19>Proveedores de servicio.</span><span class=T16>&nbsp;</span><span class=T35>Tanto la cuenta virtual a la cual se le asignará la cuenta CLABE, como los sistemas de pago son operados por un tercero contratado por Visor, quien proveerá el uso y gestión de la cuenta virtual y el sistema de pagos SPEI; este sistema es operado por Banco de México y bajo su infraestructura.</span><span class=T16> Por este acuerdo, USTED acepta que los servicios aquí descritos, así como los procesos de transferencias electrónicas, son responsabilidad del proveedor de servicio. USTED acepta que Visor hará todo lo posible y que esté a su alcance para que la transferencia tenga éxito, pero la responsabilidad es del proveedor de servicio.</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P15 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>c.</span><span class=T18>Información</span><span class=T16>. Nos esforzamos por mantener información actualizada sobre ubicación, disponibilidad y horarios de nuestros proveedores de servicio. Sin embargo, usted acepta que Visor no es responsable de ninguna información incompleta o inexacta que pudiera ser publicada respecto a estos servicios.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol></li></ol><p class=P17>&nbsp;</p><p class=P12><span class=T20>Mandato de Usted a Visor.</span></p><p class=P1><span class=T19>USTED, </span><span class=T16>en este acto autoriza y faculta a VISOR ADL S.A.P.I. DE C.V. (</span><span class=T18>“VISOR”</span><span class=T16>), a realizar los siguientes actos:</span></p><ol><li><p class=P2 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(1)</span><span class=T16>Realizar todos los actos tendientes y necesarios para crear una cuenta virtual a efecto de que sea el eje para recibir los pagos que el REMITENTE le adeude y a efectos de realizar los pagos al BENEFICIARIO y transferencias a la cuenta, cuyo titular sea </span><span class=T18>USTED, </span><span class=T16>de las cantidades restantes;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P21 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(2)</span><span class=T17>Solicitar información al </span><span class=T19>REMITENTE </span><span class=T17>respecto de los pagos adeudados a favor de</span><span class=T19> USTED;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P21 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(3)</span><span class=T16>Girar instrucciones al </span><span class=T18>REMITENTE</span><span class=T16> a efecto de realizar los pagos que éste último le adeude a la cuenta virtual que se haya creado en cumplimiento de lo anterior;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P21 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(4)</span><span class=T17>Solicitar información al </span><span class=T19>BENEFICIARIO</span><span class=T17> respecto de las cantidades que </span><span class=T19>USTED</span><span class=T17> adeude, derivadas del crédito que </span><span class=T19>USTED</span><span class=T17> haya contratado con dicho </span><span class=T19>BENEFICIARIO</span><span class=T17>;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P21 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(5)</span><span class=T17>Girar instrucciones al Proveedor de Servicios que opera la cuenta virtual que se haya creado para efectos del presente servicio, a efectos de que se re-direccionen los pagos a las cuentas que </span><span class=T19>VISOR</span><span class=T17> le indique, en base a la información que haya obtenido tanto del </span><span class=T19>REMITENTE</span><span class=T17> como del </span><span class=T19>BENEFICIARIO;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P2 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(6)</span><span class=T16>De las cantidades recibidas en la Cuenta Virtual, realizar los pagos al </span><span class=T18>BENEFICIARIO;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P2 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(7)</span><span class=T16>Devolver las cantidades que resten después de haber realizado los pagos al </span><span class=T18>BENEFICIARIO;</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><ol><li><p class=P2 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(8)</span><span class=T16>Conservar en depósito las cantidades recibidas en la Cuenta Virtual por un período que no exceda de las 17:00 horas del mismo día en que se haya realizado el depósito.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P1><span class=T18>VISOR</span><span class=T16> en el desempeño de su encargo se sujetará única y exclusivamente a las instrucciones recibidas por parte de </span><span class=T18>USTED</span><span class=T16>, en su carácter de Mandante. Sólo actuará en el ejercicio de su encargo; por lo que situaciones ajenas a su voluntad, tales como: (i) incumplimiento de pagos por parte del </span><span class=T18>REMITENTE</span><span class=T16>; (ii) falta de pagos al </span><span class=T18>BENEFICIARIO</span><span class=T16>; y (iii) cobro de comisiones, intereses y demás penalidades por parte del </span><span class=T18>BENEFICIARIO</span><span class=T16>, no serán responsabilidad de </span><span class=T18>VISOR</span><span class=T16>; y, en este acto, </span><span class=T18>USTED</span><span class=T16>, libera a </span><span class=T18>VISOR</span><span class=T16>, de cualquier responsabilidad al respecto, debiendo sacarlo en paz y a salvo de cualquier situación legal derivada de estos actos.</span></p><p class=P1><span class=T18>VISOR</span><span class=T16>, en el ejercicio de este Mandato, tiene las siguientes obligaciones:</span></p><ol><li><p class=P22 style=margin-left:1.251cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:1.27cm>(1)</span><span class=T16>Consultar a </span><span class=T18>USTED</span><span class=T16>, en su calidad de Mandante para todo lo no previsto en el presente Mandato.</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P22 style=margin-left:1.251cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:1.27cm>(2)</span><span class=T16>Dar cuentas exactas de todos y cada uno de los movimientos efectuados para cubrir los pagos respectivos.</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P22 style=margin-left:1.251cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:1.27cm>(3)</span><span class=T16>Informar a </span><span class=T18>USTED</span><span class=T16>, en su calidad de Mandante, sobre algún hecho o circunstancia que puedan determinarlo a revocar o modificar su encargo.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P1><span class=T18>USTED, </span><span class=T16>en su calidad de Mandante</span><span class=T18>,</span><span class=T16> tiene las siguientes obligaciones:</span></p><ol><li><p class=P3 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(1)</span><span class=T16>Dar aviso a </span><span class=T18>VISOR</span><span class=T16> en el supuesto de modificar las instrucciones de pago dirigidas al </span><span class=T18>REMITENTE</span><span class=T16>, supuesto que ocasiona un incumplimiento y sería causal de rescisión en términos de lo previsto en la cláusula décima cuarta del Contrato del cual forma parte integrante este Anexo;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P3 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(2)</span><span class=T16>Dar aviso a </span><span class=T18>VISOR</span><span class=T16> en el supuesto de modificar las condiciones pactadas con el </span><span class=T18>BENEFICIARIO</span><span class=T16>;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P3 style=margin-left:0cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(3)</span><span class=T16>Informar por escrito a </span><span class=T18>VISOR</span><span class=T16> en caso de revocación del presente Mandato.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol><p class=P14><span class=T21>Pagos.</span></p><p class=P14><span class=T19>Responsabilidad de Pago.</span><span class=T16> </span><span class=T18>USTED</span><span class=T16> es la única responsable del cumplimiento de las obligaciones de pago del crédito frente al </span><span class=T18>BENEFICIARIO</span><span class=T16>. </span><span class=T18>VISOR</span><span class=T16> sólo funge como auxiliar en proporcionar un servicio que le brinda agilidad a estos pagos. En este sentido, en el supuesto de que el </span><span class=T18>REMITENTE</span><span class=T16> por cualquier motivo no cumpla con realizar los pagos en el tiempo y la forma convenida con </span><span class=T18>USTED</span><span class=T16>; y por tal motivo, no se logren realizar los pagos a favor del </span><span class=T18>BENEFICIARIO</span><span class=T16> en tiempo y forma; el único responsable de cumplir con estos pagos y con los intereses, comisiones, penalidades y otros cargos que, en su caso, se generen, será </span><span class=T18>USTED</span><span class=T16>.</span></p><p class=P14><span class=T19>Cargos. </span><span class=T16>Por cada transacción que realice, USTED, acepta pagar a favor de </span><span class=T18>VISOR</span><span class=T16> una comisión por la transacción (la&nbsp;</span><span class=T19>\"Comisión de Transacción\"</span><span class=T16>), adicional al monto de la transacción. Podrían corresponder cargos adicionales. El pago debe efectuarse en el momento en que se envía la Transacción para su procesamiento. </span><span class=T18>VISOR </span><span class=T16>solo acepta el pago en Pesos Mexicanos.</span></p><p class=P14><span class=T19>Otros cargos. </span><span class=T18>VISOR</span><span class=T16> no es responsable de ninguna tarifa o cargo que pudieran cobrar las instituciones financieras relacionadas con los pagos. </span><span class=T18>VISOR </span><span class=T16>no es responsable de ninguna comisión que cargue el </span><span class=T18>BENEFICIARIO</span><span class=T16>, ni es responsable de cargos por insuficiencia de fondos, comisiones por reversión de cargos o tarifas similares que fueren cobrados a </span><span class=T18>USTED</span><span class=T16> por su banco u otros proveedores, en relación con su uso del Servicio.</span></p><p class=P23><span class=T21>Restricciones.</span></p><p class=P14><span class=T19>Generales.</span><span class=T16>&nbsp;En cualquier momento, sin previo aviso y a nuestra entera discreción, podemos rechazar cualquier transacción o limitar el monto a transferir, ya sea en una Transacción individual o en un conjunto de Transacciones. Nos reservamos el derecho, en cualquier momento, y periódicamente, de modificar o suspender el servicio (o cualquiera de sus partes) con o sin previo aviso.</span></p><p class=P14><span class=T19>Demoras.</span><span class=T16>&nbsp;Su transacción podría ser demorada o cancelada en cualquier momento sin previo aviso. Podríamos demorar o cancelar su Transacción por motivos que incluyen, pero no se limitan a: verificación de identidad; verificación de cumplimiento con normas de fraude y control de lavado de activos; contactar y localizar a usted, a su Beneficiario, o a su Remitente.</span></p><p class=P14><span class=T19>Actividades restringidas.</span><span class=T16>&nbsp;Como usuario de nuestros Servicios o, durante su interacción con Visor, usted se compromete a:</span></p><ol><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(1)</span><span class=T16>No incumplir el presente anexo, o cualquier otro acuerdo entre </span><span class=T18>USTED</span><span class=T16> y </span><span class=T18>VISOR</span><span class=T16>;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(2)</span><span class=T16>Instruir al </span><span class=T18>REMITENTE</span><span class=T16> respecto a realizar los pagos de las facturas que adeude a su favor en la cuenta CLABE integrante del Sistema de Pagos cuyo uso otorga </span><span class=T18>VISOR</span><span class=T16> como parte del Servicio;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(3)</span><span class=T16>No cambiar por ningún motivo la cuenta CLABE conforme al inciso ii anterior; y no cambiar la instrucción de pago al </span><span class=T18>REMITENTE</span><span class=T16>;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(4)</span><span class=T16>No proporcionar información falsa, incorrecta o engañosa;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(5)</span><span class=T16>No negarse a cooperar en caso de investigación o a proporcionar comprobación de su identidad o de cualquier información que nos brinde;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(6)</span><span class=T16>No usará un servidor proxy de anonimato;</span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(7)</span><span class=T16>No compartir los números o información de Transacciones con nadie diferente al REMITENTE, su </span><span class=T18>DESTINATARIO</span><span class=T16> o su </span><span class=T18>BENEFICIARIO</span><span class=T16>; </span><span class=odfLiEnd>&nbsp; </span></p></li><li><p class=P44 style=margin-left:1.27cm><span class=ListLabel_20_4 style=display:block;float:left;min-width:0.635cm>(8)</span><span class=T16>No violar ninguna otra restricción de este acuerdo del usuario.</span><span class=odfLiEnd>&nbsp; </span></p></li></ol></uib-accordion-body></div><div uib-accordion-group class=panel-default is-open=status.open><uib-accordion-heading>Errores y Problemas.</uib-accordion-heading><uib-accordion-body><h1 class=Heading_20_1><a id=a__Errores_y_Problemas_><span></span></a><span class=T14>Errores y Problemas.</span></h1><p class=P25><span class=T19>Errores.</span><span class=T16>&nbsp; En el servicio que ofrece </span><span class=T18>VISOR</span><span class=T16>, a efecto de facilitar sus pagos a favor de Instituciones Financieras, intervienen actividades de terceros que no están bajo control de </span><span class=T18>VISOR</span><span class=T16>. </span><span class=T18>VISOR </span><span class=T16>se compromete a contratar los servicios con aquellas personas que se encuentran debidamente capacitadas y ofrecen altos niveles de seguridad en sus transacciones. Así tenemos, que el sistema de pagos utilizado para el servicio, es operado por Banco de México. &nbsp;En virtud de lo anterior, </span><span class=T18>VISOR</span><span class=T16> no será responsable por errores que pudieran surgir por actos que no sean directamente imputables al mismo, tales como: </span><span class=T18>Errores Operativos:</span><span class=T16> Esto son, fallas en los sistemas de cómputo ocasionados por cualquier factor, sea hackeo, crackeo, virus, vulnerabilidades en los sistemas, ingeniería inversa, fallas eléctricas, etc.; </span><span class=T18>Errores Financieros:</span><span class=T16> Que el </span><span class=T18>REMITENTE</span><span class=T16> no haya pagado en tiempo y forma las cantidades adeudadas; o que las instrucciones y/o información respecto de los pagos de las partes contengan errores; </span><span class=T18>Errores Sistémicos:</span><span class=T16> Que una de las partes en el proceso de pago no cumpla y por ende, no se pueda cumplir con las obligaciones de pago posteriores.</span></p><p class=P25><span class=T19>Errores.</span><span class=T16>&nbsp;Usted tiene derecho a controvertir errores en su transacción. Si usted cree que hay un error, póngase en contacto con nosotros antes de que transcurran 30 días después de haber realizado la transacción, llamando al (</span><span class=T29>55) 66720447</span><span class=T16> o </span><span class=T35>por correo electrónico a&nbsp;</span><a href=../../../C:%5CUsers%5CVeronica%5CAppData%5CLocal%5CMicrosoft%5CWindows%5CINetCache%5CContent.Outlook%5CF1WIFL7P%5C%22mailto:soporte><span class=T39>soporte@Visor.io</span></a><span class=T16>. También puede ponerse en contacto con nosotros para obtener por escrito una explicación de sus derechos.</span></p><p class=P8><span class=T22>Indemnización.</span></p><p class=P8><span class=T35>Usted acepta indemnizar y eximir de toda responsabilidad a Visor y sus Proveedores de Servicio, Empresas de Servicios de cualquier reclamación o demanda, incluidos los honorarios razonables de los abogados: por los actos a su cargo derivados del mal uso que usted haya hecho de los servicios, su relación con los servicios, su incumplimiento del presente anexo o que usted haya violado algún derecho de terceros.</span></p><p class=P8><span class=T37>Fraudes.</span><span class=T35>&nbsp;A efecto de evitar fraudes y/o estafas </span><span class=T36>USTED, </span><span class=T35>se obliga a utilizar únicamente la Cuenta CLABE proporcionada por Visor a efecto de utilizar los servicios ofrecidos dentro de la plataforma segura visor.io. Tanto la cuenta virtual a la cual se le asignará la cuenta CLABE, como los sistemas de pago son operados por un tercero contratado por Visor, quien proveerá el uso y gestión de la cuenta virtual y el sistema de pagos SPEI; este sistema es operado por Banco de México y bajo su infraestructura. Si cree que alguien está tratando de estafarlo o hacerle un fraude, o si su nombre de usuario o contraseña para acceso a la plataforma de </span><span class=T36>VISOR</span><span class=T35> o la cuenta CLABE se han extraviado o han sido robados, avísenos de inmediato al teléfono (</span><span class=T29>55) 66720447</span><span class=T35> o por correo electrónico a&nbsp;</span><a href=../../../C:%5CUsers%5CVeronica%5CAppData%5CLocal%5CMicrosoft%5CWindows%5CINetCache%5CContent.Outlook%5CF1WIFL7P%5C%22mailto:soporte><span class=T39>soporte@Visor.io</span></a><span class=T35>.</span></p><p class=P1>&nbsp;</p></uib-accordion-body></div></uib-accordion><br><br></div>");
